import './navbar.css'
import React from 'react';
import NavbarLogin from './navbarLogin'
import Login,{handleShow} from './auth/login'
import Register,{handleShowRegister} from'./auth/register'

function Navbar() {
    const admin= JSON.parse(sessionStorage.getItem("Admin"));
    const isLogin= JSON.parse(sessionStorage.getItem("isLogin"));
    if(admin==false && isLogin==true){
      return(<NavbarLogin/>)
    }
 
  
    return ( 
        <div class = "navbar" >
        <div id = "nav-right" >
        <img src = { require("./assets/Icon.png").default } alt = "Icon" />
        </div> 
        <div id = "nav-left" > 
        <button id = "login" onClick={<Login handleShow/>}> Login </button> 
        <button id = "register" onClick= {<Register handleShowRegister/>}> Register </button>  
        </div >

      
    
    </div>
    );
}

export default Navbar
